const getNastavnici = async (state = [], action) => {
  if (action.type === 'GET_NASTAVNICI') {
    const nastavnici = await fetch('http://localhost:3001/nastavnici');
    const response = await nastavnici.json();

    return response.then((result) => result);
  }
  return state;
};

export default getNastavnici;
